// Navbar.js
import React from 'react';
import './Navbar.css';
import { Link } from 'react-router-dom';


const Navbar = () => {
    return (
      <nav>
        <select>
          <option value="/">
            <Link to="/">Home</Link>
          </option>
          <option value="/settings">
            <Link to="/settings">Settings</Link>
          </option>
          <option value="/movies">
            <Link to="/movies">Movies</Link>
          </option>
        </select>
      </nav>
    );
  };
  
  export default Navbar;
